const { directive } = require("@babel/types");
import Svgmain from "./images/Svgmain.svg";

function Hero()
{
    return(
        <div className="w-screen h-screen p-5 m-4" id="main-hero">
            <div className="w-auto h-auto px-4 py-2" id="main-svg">
                <img src={Svgmain}/>
            </div>
        </div>
    )
}

export default Hero;
